import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';

class NavBar extends React.Component {
    render() {
      return (
        <div>
          <ul>
            <li style={{listStyleType: "none"}}><a className="nav-link" href="#">Home</a></li>
            <li><a className="nav-link" href="nav-pages/about-me.html">About Me</a></li>
            <li><a className="nav-link" href="#stickers">Stickers</a></li>
            <li><a className="nav-link" href="nav-pages/custom-order.html">Custom Order</a></li>
            <li><a className="nav-link" href="nav-pages/contact-me.html">Contact Me</a></li>
            <li className="nav-images-li">
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw", marginTop: "7px"}} src="./Images/profileIcon.png"></img></a></li>
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw"}} src="./Images/shoppingIcon.png"></img></a></li>
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw", marginTop: "7px"}} src="./Images/shoppingCart.png"></img></a></li>
            </li>
          </ul>
        </div>
      );
    }
}

  export default NavBar;
